import React from "react";

function Boy(props) {
  return (
    <div>
      <h1>{props.contact}</h1>
      <img src="{props.photo}" alt="photo" />
      <h3>{props.tel}</h3>
      <p>{props.email}</p>
    </div>
  );
}

export default Boy;
